import * as React from 'react';
import Box from '@mui/material/Box';
import { Typography } from '@mui/material';

export default function BoxSystemProps({ job }) {
  return (
    <Box
      height={200}
      width={300}
      my={5}
      display="grid"
      alignItems="center"
      gap={2}
      p={2}
      marginLeft={5}
      borderRadius={3}
      sx={{ border: '2px solid grey', position: 'relative' }}
    >
      <Typography
        textAlign="center"
        sx={{ position: 'absolute', top: '10px', width: '100%' }}
      >
        {job.title}
      </Typography>
      <Box sx={{ marginTop: '40px' }}>
        {job.skills}
      </Box>
    </Box>
  );
}
